import React from "react";
import "./Navbar.css";

function Navbar(props) {
  return (
    <div className="navbar">
      <div className="navbar__left">
        <li> Brandon Vincent </li>
      </div>
      <ul className="navbar__content">
        <li> Home </li>
        <li> About </li>
        <li> Projects</li>
        <li> Resume </li>
        <li> Contact Me </li>
      </ul>
    </div>
  );
}

export default Navbar;
